import React from 'react';

function Profile() {
  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-4">Profile</h1>
      <p>Manage your account settings.</p>
    </div>
  );
}

export default Profile;
